{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/vikarna/time-series-analysis-intro?scriptVersionId=94679540\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"markdown","source":"**Time Series data is data that is observed at a fixed interval time and it could be measured daily, monthly, annually, etc. Time series has a lot of applications, especially on finance and also weather forecasting. In this article, we analyze and also forecast time series data .Fairly simple data is taken from Bank Indonesia, consumer price index (CPI) data from December 2002 until April 2020.**","metadata":{}},{"cell_type":"markdown","source":"* We have to gather and pre-process the data, and also, we should know the domain knowledge of the data that we use,\n\n* We analyze the time series, visually and statistically,\n\n* We identify the perfect model based on its autocorrelation,\n\n* We diagnose the model whether it meets the independence assumption and finally,\n\n* We can use the model for doing forecasting","metadata":{}},{"cell_type":"markdown","source":"**Time series analysis is performed on Indonesia’s CPI data starts from December 2002 until April 2020. We can get the data from Bank Indonesia.**","metadata":{}},{"cell_type":"code","source":"library(tidyverse)\nlibrary(lubridate)\nlibrary(ggplot2)\nlibrary(FitAR)","metadata":{"execution":{"iopub.status.busy":"2022-05-03T01:26:28.771079Z","iopub.execute_input":"2022-05-03T01:26:28.773173Z","iopub.status.idle":"2022-05-03T01:26:28.79248Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"df <- read.csv('../input/indonesia-inflation-clean/Indonesia_Inflation.csv')\n\ncolnames(df) <- c('Time','InflationRate')\n\n\nhead(df)","metadata":{"execution":{"iopub.status.busy":"2022-05-03T01:25:55.859078Z","iopub.execute_input":"2022-05-03T01:25:55.888718Z","iopub.status.idle":"2022-05-03T01:25:55.929503Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Cleaning the Data","metadata":{}},{"cell_type":"code","source":"df$InflationRate <-gsub(\"%$\",\"\",df$InflationRate)\ndf$InflationRate <- as.numeric(df$InflationRate)\n#df <- df[order(nrow(data):1), ]\ntail(df)","metadata":{"execution":{"iopub.status.busy":"2022-05-03T01:30:43.808087Z","iopub.execute_input":"2022-05-03T01:30:43.810094Z","iopub.status.idle":"2022-05-03T01:30:43.840188Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"cpi <-ts(df$InflationRate, frequency = 12, start = c(2002, 12))","metadata":{"execution":{"iopub.status.busy":"2022-05-03T01:26:05.319418Z","iopub.execute_input":"2022-05-03T01:26:05.320821Z","iopub.status.idle":"2022-05-03T01:26:05.33188Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# Make the DataFrame\ntidy_data <- data.frame(\n  date = seq(as.Date(\"2002-12-01\"), as.Date(\"2020-04-01\"), by = \"month\"),\n  cpi = cpi\n)\nhead(tidy_data)","metadata":{"execution":{"iopub.status.busy":"2022-05-01T23:34:10.199537Z","iopub.execute_input":"2022-05-01T23:34:10.201039Z","iopub.status.idle":"2022-05-01T23:34:10.236351Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"First, let’s introduce the consumer price index (CPI). CPI is an index that measures the price change of consumer goods at a certain time from its base year. The formula looks like this,\n\n![image.png](attachment:278ca371-3be1-450f-bfb4-c17776b1041a.png)\n\nEach CPI values is measured every month. Here is the code and also the plot as the results from this code,","metadata":{},"attachments":{"278ca371-3be1-450f-bfb4-c17776b1041a.png":{"image/png":""}}},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"markdown","source":"# CPI Visualization","metadata":{}},{"cell_type":"code","source":"p <- ggplot(tidy_data, aes(x=date, y=cpi)) +\n  geom_line(color=\"red\", size=1.1) +\n  theme_minimal() +\n  xlab(\"\") +\n  ylab(\"Consumer Price Index\") +\n  ggtitle(\"Indonesia's Consumer Price Index\", subtitle = \"From December 2002 Until April 2020\")\np","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![Rplot001 (13).png](attachment:c773d985-bfc8-4891-8149-584dc4dd52fd.png)","metadata":{},"attachments":{"c773d985-bfc8-4891-8149-584dc4dd52fd.png":{"image/png":""}}},{"cell_type":"markdown","source":"Based on the graph, We cannot see any trend or seasonal pattern. Despite it looks seasonal, the peak of each year is not in the same month, so it’s not seasonal. Then, this graph also don’t have an increasing or decreasing trend on it. Therefore, this graph is stationary because the statistical properties of the data, such as mean and variance, don’t have any effect because of the time.\n\nBeside of the graph, we can measure statistical summary from the data. We can see that the maximum inflation occurs in November 2005 with the rate of CPI is 18.38. Then, the minimum inflation occurs in November 2009 with the rate of CPI is 2.41. With that information, we can conclude that the data doesn’t have a seasonal pattern on it.","metadata":{}},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"markdown","source":"# Model Identification","metadata":{}},{"cell_type":"markdown","source":"After we analyze the data, then we can do modelling based on the data. There are 2 models that we will consider for this case, there are Auto Regression (AR) model and also the Moving Average (MA) model. Before we use the model, we have to identify which model that perfectly fits on the data based on its autocorrelation and which lag suits the model. To identify this, we will make the Auto Correlation Function (ACF) plot and also Partial Auto Correlation Function (PACF) plot like this one below and here is the code,","metadata":{}},{"cell_type":"code","source":"acf(cpi, plot = T, main = \"ACF Plot of CPI\", xaxt=\"n\")\npacf(cpi, plot = T, main = \"PACF Plot of CPI\", xaxt=\"n\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![Rplot001 (14).png](attachment:53299171-e83b-4698-ab7d-f9945903ff9c.png)","metadata":{},"attachments":{"53299171-e83b-4698-ab7d-f9945903ff9c.png":{"image/png":""}}},{"cell_type":"markdown","source":"![Rplot001 (15).png](attachment:1d20d2ed-b478-47e6-9fa2-5339760d1855.png)","metadata":{},"attachments":{"1d20d2ed-b478-47e6-9fa2-5339760d1855.png":{"image/png":""}}},{"cell_type":"markdown","source":"Based on the plot above, how we can choose the perfect model for this data. To choose between AR and MA model, we can see this summary below,\n\n![image.png](attachment:c6ecbddf-e978-4c3d-a72f-c63bd7ee5c57.png)\n","metadata":{},"attachments":{"c6ecbddf-e978-4c3d-a72f-c63bd7ee5c57.png":{"image/png":""}}},{"cell_type":"markdown","source":"The summary says that AR(p) will fit the model if the ACF plot tails off and PACF plot cuts off to nearly 0 after lag p. Then, the MA(q) model will fit if the ACF plot cuts off to nearly 0 after lag Q and the PACF plot tails off. If both plots are tailing off, then we can use the ARMA(p, q) model to it. For those who still confused about tail off and cut off, tail off means that the value is decreasing gradually and not drop to nearly 0. Then cut off means that the autocorrelation decrease to nearly 0 after the previous lag.\n\nBased on that information, we can see that the ACF plot decreases gradually (tail off) and the PACF plot decreases to nearly 0 after lag-1. Therefore, for this model, we will use the AR(1) model for the next step.","metadata":{}},{"cell_type":"code","source":"ar1 <- arima(cpi , order = c(1, 0, 0))\n\nar1","metadata":{"execution":{"iopub.status.busy":"2022-05-03T01:26:45.224355Z","iopub.execute_input":"2022-05-03T01:26:45.227133Z","iopub.status.idle":"2022-05-03T01:26:45.255367Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Model Diagnosis","metadata":{}},{"cell_type":"code","source":"acf(ar1$residuals)\nres <- LjungBoxTest(ar1$residuals, k=2, StartLag=1)\nplot(res[,3],main= \"Ljung-Box Q Test\", ylab= \"P-values\", xlab= \"Lag\")\nqqnorm(ar1$residuals)\nqqline(ar1$residuals)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**To make sure that the model can be used for forecasting and the other measurement, we have to test the model using Ljung Box Test**","metadata":{}},{"cell_type":"markdown","source":"![Rplot001 (17).png](attachment:763bfa87-fa83-4b17-9d26-55585e6b1f86.png)","metadata":{},"attachments":{"763bfa87-fa83-4b17-9d26-55585e6b1f86.png":{"image/png":""}}},{"cell_type":"markdown","source":"![Rplot002 (2).png](attachment:78f20db1-92db-4e85-b80a-0b9b076fc940.png)","metadata":{},"attachments":{"78f20db1-92db-4e85-b80a-0b9b076fc940.png":{"image/png":""}}},{"cell_type":"markdown","source":"![Rplot003.png](attachment:b12bcc50-4ccf-4a2f-87a4-eb6f6a32987e.png)","metadata":{},"attachments":{"b12bcc50-4ccf-4a2f-87a4-eb6f6a32987e.png":{"image/png":""}}},{"cell_type":"markdown","source":"**Based on these plots, we can see that the Q-test plot have p-values above 0.05, then the ACF plot shows no significance between another lag, and finally, we can see that the QQ-Plot is almost fit into the line, so we can assume that is already normal. Therefore, we can use the model to do the forecast.**","metadata":{}},{"cell_type":"code","source":"library(forecast)\nfuturVal <- forecast(ar1, h=10, level=c(99.5))\nplot(futurVal)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Forecasting","metadata":{}},{"cell_type":"markdown","source":"![Rplot001 (16).png](attachment:b8e06db9-985d-459a-a9a8-232e0fe1f57e.png)","metadata":{},"attachments":{"b8e06db9-985d-459a-a9a8-232e0fe1f57e.png":{"image/png":""}}}]}